import React, { useState } from 'react';

import {
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarToggler,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBCollapse,
  MDBIcon
} from 'mdb-react-ui-kit';
import './navbar.css'; // Import your custom CSS file

export default function App() {
  const [showNav, setShowNav] = useState(false);

  return (
    <MDBNavbar expand='lg' light bgColor='light' style={{ padding: 45 }}>
         {/* <MDBNavbarBrand href='/' style={{fontSize:50, paddingRight:50}}>
            Moon Nails
          </MDBNavbarBrand> */}
      <MDBContainer fluid>
        <MDBNavbarToggler
          type='button'
          aria-expanded='false'
          aria-label='Toggle navigation'
          onClick={() => setShowNav(!showNav)}
        >
          <MDBIcon icon='bars' fas />
        </MDBNavbarToggler>
        <MDBCollapse navbar show={showNav}>
          <MDBNavbarNav style={{ fontSize: 20 }}>
            <MDBNavbarItem style={{ paddingRight: 25 }}>
              <MDBNavbarLink className='navbar-link' active aria-current='page' href='/'>
                Home
              </MDBNavbarLink>
            </MDBNavbarItem>
            <MDBNavbarItem style={{ paddingRight: 25 }}>
              <MDBNavbarLink className='navbar-link' active aria-current='page' href='services'>
                Services
              </MDBNavbarLink>
            </MDBNavbarItem>
            <MDBNavbarItem style={{ paddingRight: 25 }}>
              <MDBNavbarLink className='navbar-link' active aria-current='page' href='gallery'>
                Gallery
              </MDBNavbarLink>
            </MDBNavbarItem>
            <MDBNavbarItem style={{ paddingRight: 25 }}>
              <MDBNavbarLink className='navbar-link' active aria-current='page' href='contacts' tabIndex={-1} aria-disabled='true'>
                Contacts
              </MDBNavbarLink>
            </MDBNavbarItem>
            <MDBNavbarBrand href='/' style={{fontSize:40,marginRight:50}}>
            Moon Nails
          </MDBNavbarBrand>
          </MDBNavbarNav>
        </MDBCollapse>
      </MDBContainer>
    </MDBNavbar>

  );
}
